import React from "react";
import "./App.css";
import Routes from "./Routes";
import { Provider } from "react-redux";
import store from "./Redux/Store";

function App() {
  return (
    <>
      <Provider store={store}>
        <Routes />
      </Provider>
    </>
  );
}

export default App;
